    // Toggle filter group visibility
    function toggleFilterGroup(header) {
      const content = header.nextElementSibling;
      content.classList.toggle('open');
    }

    // Initialize
    function init() {
      console.log('Initializing app...');
      console.log('POKEDEX_DATA entries:', Object.keys(POKEDEX_DATA).length);
      console.log('First Pokemon:', Object.entries(POKEDEX_DATA)[0]);
      
      // Convert pokedex data to array
      allPokemon = Object.entries(POKEDEX_DATA).map(([id, data]) => {
        console.log(`Processing ${id}:`, data);
        return {
          id,
          ...data,
          bst: calculateBST(data.baseStats)
        };
      });

      // Filter out non-standard Pokemon if needed
      allPokemon = allPokemon.filter(p => !p.isNonstandard || p.isNonstandard === 'Past');

      console.log('Total Pokemon after filtering:', allPokemon.length);
      
      // Initialize UI
      initTypeButtons();
      initFormatButtons();
      initSliders();
      initAbilitySearch();
      initMoveSearch();

      // Initial render
      applyFilters();
    }

    // Calculate Base Stat Total
    function calculateBST(stats) {
      if (!stats) return 0;
      return (stats.hp || 0) + (stats.atk || 0) + (stats.def || 0) + (stats.spa || 0) + (stats.spd || 0) + (stats.spe || 0);
    }

    // Initialize type buttons
    function initTypeButtons() {
      const types = ['Normal', 'Fire', 'Water', 'Electric', 'Grass', 'Ice', 
                     'Fighting', 'Poison', 'Ground', 'Flying', 'Psychic', 'Bug', 
                     'Rock', 'Ghost', 'Dragon', 'Dark', 'Steel', 'Fairy'];
      
      const container = document.getElementById('typeButtons');
      types.forEach(type => {
        const btn = document.createElement('button');
        btn.className = `type-btn ${type.toLowerCase()}`;
        btn.textContent = type;
        btn.onclick = () => toggleType(type, btn);
        container.appendChild(btn);
      });
    }

    // Toggle type filter
    function toggleType(type, btn) {
      if (filters.types.has(type)) {
        filters.types.delete(type);
        btn.classList.remove('active');
      } else {
        filters.types.add(type);
        btn.classList.add('active');
      }
      triggerFilters();
    }

