    // Helper: expand regulation dexRanges to allowlist
    function expandRegulationAllowlist(regDef) {
      const allowed = new Set();
      const excluded = new Set(regDef.excludedNames || []);
      (regDef.dexRanges || []).forEach(({ dex, ranges }) => {
        const list = orderedDexLists[dex];
        if (!Array.isArray(list)) return;
        ranges.forEach(([from, to]) => {
          for (let i = Math.max(1, from); i <= Math.min(list.length, to); i++) {
            const name = list[i - 1];
            if (name && !excluded.has(name)) allowed.add(name);
          }
        });
      });
      return allowed;
    }

